import React, { useState } from 'react';

const Contact = () => {
const [data, setData] = useState({
    fullname:'',
    phone:'',
    email:'',
    message:''
});
const InputEvent = (event) =>{
  const{name, value} = event.target;
  setData((preVal) =>{
  return{
      ...preVal,[name]:value,
  };
  });
};

const formSubmit = (e) => {
e.pr

};

    return (
        <>
        <div className="my-5">
               <h1 className="text-center"> This is Contact page</h1>
        </div>
<div className="container conatat_div">
    <div className="row">
        <div className="col-md-6 col-10 mx-auto">
        <form onSubmit={formSubmit}>
        <div className="mb-3">
  <label for="exampleFormControlInput1" className="form-label">Full Name</label>
  <input type="text" className="form-control" id="exampleFormControlInput1" name="fullname" value={data.fullname} onChange={InputEvent} placeholder="Enter Full Name" />
</div>
<div className="mb-3">
  <label for="exampleFormControlInput1" className="form-label">Phone Number</label>
  <input type="number" className="form-control" id="exampleFormControlInput1" name="phone" value={data.phone} onChange={InputEvent} placeholder="Enter Phone Number" />
</div>
<div className="mb-3">
  <label for="exampleFormControlInput1" className="form-label">Email address</label>
  <input type="email" className="form-control" id="exampleFormControlInput1" name="email" value={data.email} onChange={InputEvent} placeholder="name@example.com" />
</div>

<div className="mb-3">
  <label for="exampleFormControlTextarea1" className="form-label">Message</label>
  <textarea className="form-control" id="exampleFormControlTextarea1" name="message"  value={data.message} onChange={InputEvent} rows="3"></textarea>
</div>

<div class="col-12">
    <button className="btn btn-outline-primary" type="submit">Submit form</button>
  </div>

</form>
        </div>

    </div>

</div>



        </>

    )
}

export default Contact;
